import { useSelector} from "react-redux";




export default function PokemonDetall() {
    const pokemones=useSelector(store =>store.pokemon.pokemons)
    console.log(pokemones)
  
  return (<>
  
     <br />
     <br />
     <br />
     <div>
        {
            pokemones.map(e=>{
                return <>
                <li>Nombre:{e.name}</li>
                <li>id:{e.id}</li>
                <li>Stats:{e.Estadísticas.map(e=>e)}</li>
                <li>{e.peso}</li>
                </>
                
            })
        }
     </div>

     
  
  
  </>
    
  )
}
